import React from 'react';
import ReactDOM from 'react-dom';
const name="alka kurrey";
ReactDOM.render(
<>
<h1><a href="index.html">{name}</a></h1>
<p>{name} is a functional div element</p>
<img src='http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/alien_1_2.png' alt="pimg"/>
</>,
document.getElementById('root'));
